import React from 'react';
import styled from '@emotion/styled';
import { Switch,
  Route,
  Link,
  NavLink,
  Redirect,
  useParams,
  useRouteMatch } from 'react-router-dom';
import Nav from './Components/NavBar';
import Shop from './Components/Shop';

const Title = styled.div`
  width: 40%;
  max-width: 400px;
  position: absolute;
  text-align: center;
  left: 4%;
  top: 35px;
  font-size: 48px;
  color: black;
  border-bottom-style: solid;
  border-bottom-width: 2px;
  border-color: black;

  @media(max-width: 768px) {
    position: static;
    font-size: 8vw;
    text-align: center;
    width: 300px;
    margin: 4px auto;
    padding: 0;
    text-align: center;
  }
`;
const FlavorText = styled.div`
  position: absolute;
  right: 4%;
  top: 50px;
  font-style: italic;
  color: grey;

  @media(max-width: 768px) {
    font-size: 3vw;
    position: static;
    text-align: center;
    width: 100px;
    margin: 4px auto;
    padding: 0;
    text-align: center;
  }
`;

function App() {
  return (
    <div>
      <Title>Bear Lake Honey</Title>
      <FlavorText>Bee Happy</FlavorText>
      <Nav/>
      <Switch >
        <Route path="/">
          <Shop/>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
